		        headline: "Another headline"
		      }
		    ]
		  }
		};	
		// debugger
		const titleval = "hiii"
		this.state = { para: "hello", h1: "some"}
		var { para } = this.state;
		const { h1 } = this.state;
		const head = this.props.data;
		return(
	  	 <BaseLayout>
		  	<h1>New CV Page</h1>
		  	<div className="App">
		      {data.content.body.map(block => block.headline)[0]}
		    </div>
		  	<div>
		  		<p>{ titleval }</p>
		  		<h1>{ para }</h1>
		  		<h1>{ h1 }</h1>
		  	</div>
	  	</BaseLayout>
	  	)
	}
}
export default Cv;
